        <li><Link href="/about"><a>About</a></Link></li>
        <li><Link href="/cv"><a>CV</a></Link></li>
      </ul>
  </div>


);

<style jsx>{`
  ul {
    background: #333;
    color: #fff;
    list-style: none;
    display: flex;
